import { Container, Row, Col } from "react-bootstrap";
const Home = ({search}) => {
    const onSearch = (word) => {
        search(word)
    }

    return(
        <div className="home">
            <Container>
                <Row>
                    <Col>
                    <div className="search">
             <i class="bi bi-search-heart"></i>
             <input className="form-control" placeholder="Search..." type="text" onChange={(e) => onSearch(e.target.value)}/>
            </div>
                    </Col>
                </Row>
            </Container>
